import { BrowserRouter, Route, Routes } from "react-router-dom";

import Home from "../pages/Home"

function routes(){
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/" exact element={<Home/>}/>
            </Routes>
        </BrowserRouter>
    )

}

export default routes;
